import React,{useState,useEffect} from 'react';
import { GoogleMap,InfoWindow,LoadScript, Marker} from '@react-google-maps/api';
import axios from "axios";

export default function Test() {

    const [mapData,setMapData] = useState([]);

    useEffect(() => {
        extraction();
    },[]);

    const style = {
        width : '1900px',
        height : '700px'
    };

    const center = {
        lat : 37.55480,
        lng : 126.98297
    };

    const canvas = {
        background : '#fff',
        padding: 10
    };

    const extraction = async () =>{
        await axios.get('http://somweb.cf:8000/wn-site')
        .then(value=>{
            //console.log('extraction');
            setMapData(value.data.data);
        })
    };

    const onClickbtn = () =>{
        extraction();
        //console.log("Start");
    };

    let infowidth = [];
    let info_cnt = 0;

    const makeInfowindow = (place) =>{
        infowidth_contents[info_cnt] = `<div><div id='info_title'> ${place.name} </div><br></div>`
    }
    const infowidom = new google.maps.InfoWindow();
    const showInfoWindow = ()=>{
        mapData.map((value)=>{
            google.maps.event.addListener(Marker)
        })
    }

    return (

        <div>
            <LoadScript googleMapsApiKey="AIzaSyDevvetng60XedeOqk-qW9TF-XBNQsyxdE">

            <GoogleMap
                    mapContainerStyle={style}
                    center={center}
                    zoom={10}
                >
                    {
                        mapData.map((value)=>{
                            console.log(value.lat, value.lng);
                            return (
                                <>
                                    <Marker 
                                        position={{lat : value.lat , lng : value.lng}} 
                                        icon={
                                            {
                                                url : 'O2I_blue.png',
                                                scaledSize : new google.maps.Size(15,15),
                                            }
                                        }
                                        //onMouseOver={mouseEvent}
                                        onMouseOver={(e)=>{
                                            <InfoWindow position={{lat : e.domEvent.clientX ,lng : e.domEvent.clientY}}><h1>H1</h1></InfoWindow>
                                        }}
                                    />
                                    
                                    <InfoWindow
                                        position={{lat : value.lat , lng : value.lng}}
                                    >
                                        <div style={canvas}>
                                            <h1>{value.nw_node}</h1>
                                        </div>
                                    </InfoWindow>
                                </>
                            )
                        })
                    }
                </GoogleMap>
            </LoadScript>

            <button onClick={onClickbtn}>Update</button>

        </div>
    )
}
